import "./ExpenseForm.css";
import { useState } from "react";
const ExpenseForm = () => {
  const [enteredTitle, setEnteredTitle] = useState("");
  const [enteredNumber, setEnteredNumber] = useState("");
  const [enteredDate, setEnteredDate] = useState("");
  const titleChangeHanlder = (event) => {
    setEnteredTitle(event.target.value);
  };
  const numberChangerHanlder = (event) => {
    setEnteredNumber(event.traget.value);
  };

  return (
    <form>
      <div className="new-expense__controls">
        <div className="new-expense__control">
          <label>Title</label>
          <input type="text" onChange={titleChangeHanlder}></input>
        </div>
        <div className="new-expense__control">
          <label>Title</label>
          <input
            type="number"
            min="0.01"
            step="0.01"
            onChange={numberChangerHanlder}
          ></input>
        </div>
        <div className="new-expense__control">
          <label>Title</label>
          <input type="date" min="2019-01-01" max="2022-12-31"></input>
        </div>
      </div>
      <div className="new-expense__actions">
        <button type="submit">Add Expense</button>
      </div>
    </form>
  );
};

export default ExpenseForm;
